"use strict";
// Reference type --> Object
// Implicit type
const user = {
    firstName: "shipon",
    middleName: "Hossen",
    lastName: "Raju",
};
// explicitly type
const user1 = {
    firstName: "shipon",
    middleName: "Hossen",
    lastName: "Raju",
};
// optional type
const user2 = {
    firstName: "shipon",
    lastName: "Raju",
    isMarried: false,
};
// literal type
const user3 = {
    company: "Developer Shipon",
    firstName: "shipon",
    lastName: "Raju",
    isMarried: false,
};
// read only property
const user4 = {
    company: "Developer Shipon",
    firstName: "shipon",
    lastName: "Raju",
    isMarried: false,
};
